Free OFFLINE photo translator, dictionary and phrasebook -- the ultimate foreign language tool when you are abroad! 
Translate sentences of text without data connection between English and Italian in offline mode. A must have if you travel to foreign countries - do not rely on Internet and save on data roaming charges!

Our unique translation technology often delivers translations that excel Google Translate, Microsoft Translator and Yandex while using much less storage space.
It also allows more language pairs than other paid apps having offline translation such as iTranslate.

FREE VERSION
- you will be reminded to support us by using one of our paid apps;
- you will be able to use 50 times the voice output and photo translation

TRANSLATE TEXT
- translate offline instantly as you type;
- translates from Italian to English and from English to Italian;
- fully functional translation without any internet connection;

TRANSLATE WITH VOICE / SPEECH
- voice / speech output for both Italian and English;
- allows reading individual words by tapping the desired word in the translation;

TRANSLATE CAMERA / PHOTO / PICTURE AND OCR
- take a picture of printed text and translate it in seconds offline! 
- available for both English and Italian; 
- use this feature to easily convert photos of printed text into editable text in offline mode; 

DICTIONARY / PHRASEBOOK
- dictionary and phrasebook between Italian and English;
- recognizes any word form and identifies its features (number, person, gender, etc.)
- displays all the translations for a given word;
- displayed for single words and collocations;
- allows reading individual words by tapping the desired word in the translation;

You can test the translation without buying the app at http://www.offline-translator.com

If you encounter problems with the app, please contact our customer support!
